function Header(){
    const style = {
            color : "red",
            fontSize: "50px",
            backgroundColor: "black",
            padding: "20px"
    }
    return(
        // in line style
        // بيكتب كأنه اوبجكت
        <h1 style={style}>Hello World</h1>
    );
}
export default Header;
